import React from 'react';


import "./Login.css"

const Login = (props) => {

    const { 
        email,
        setEmail,
        password,
        setPassword,
        handleLogin,
        handleSignup,
        handleAccount,
        setHasAccount,
        emailError,
        passwordError
     } = props;
    return ( 
        <section className='Login'>
            <div className="loginContainer">
                 <input 
                type="text"
                autoFocus
                required
                value={email} 
                onChange={(e) => setEmail(e.target.value)}
                />
                <p className="errorMsg">{emailError}</p>
                <label >password</label>

            </div>
        </section>
     );
}

export default Login;
